export class UserActionBroker{constructor(){this.eventList={click:"click",mousedown:"mousedown",mouseup:"mouseup",visibility:"visibility",keypress:"keypress",keydown:"keydown",keyup:"keyup"},this.eventname="user-engagement"}valid(e){return!!this.eventList[e]}fireAction(e,s,t){s.eventType=e,t.dispatchEvent(new CustomEvent(this.eventname,{bubbles:!0,composed:!0,cancelable:!1,detail:s}))}}